(366, 2, 0, 1, '2019-03-27 14:58:28', '2019-08-14 14:02:53', 5, 'ge', 1, 1, 'ინვესტორი', 'ინვესტორი', NULL, '<p style=\"text-align: justify;\">მზიური გარდენსის პროექტის ავტორი და ინვესტორი ბრიტანული კომპანია <a href=\"https://www.mrmultd.com/\" target=\"_blank\">MRMU-</a>ა, რომელსაც თავისი მრავალწლიანი მოღვაწეობის განმავლობაში არაერთი საერთაშორისო დონის მასშტაბური პროექტი განუხორციელებია. კომპანია ცნობილია თავისი დიზაინერული გადაწყვეტილებებით, ხარისხზე და ადგილობრივი საჭიროებებზე&nbsp; ორიენტირებულობით, რომელსაც მიზნად პოზიტიური ცვლილებების განხორციელება უდევს. კომპანია დაარსებული იქნა 2004 წელს&nbsp; მარკ აპტონის მიერ, რომელსაც 20 წელზე მეტი გამოცდილება აქვს უძრავი ქონების შეძენის და დეველოპმენტის სფეროში. კომპანია თანამშრომლობს მაღალკვალიფიციურ პარტნიორებთან&nbsp; და კონსულტანტებთან, რაც მას პროექტების მაღალ დონეზე განხორციელების შესაძლებლობას აძლევს.</p>\n<p style=\"text-align: justify;\">აღსანიშნავია, რომ მზიური გარდენსის პროექტი პირველი პირდაპირი ბრიტანული ინვესტიციაა აჭარაში და თავისი მასშტაბებიდან გამომდინარე დიდ წვლილს შეიტანს რეგიონის ტურისტული მიმზიდველობის ამაღლების და ასევე ახალი სამუშაო ადგილების შექმნის თვალსაზრისით.&nbsp;&nbsp;</p>', NULL, NULL, 0, 'about-us', NULL, 0, 1, 'https://mziurigardens.ge/files/about/about-mrmu.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'gardens, mziuri', 'ინვესტორი', 0, NULL),
(367, 2, 0, 1, '2019-03-27 14:58:28', '2019-08-14 14:02:53', 5, 'en', 1, 1, 'Investor', 'Investor', NULL, '<p style=\"text-align: justify;\">The developer and investor behind the Mziuri Gardens project is the British company&nbsp;&nbsp;<a href=\"https://www.mrmultd.com/\" target=\"_blank\">MRMU</a>,&nbsp;which has extensive experience of delivering large-scale projects on an international level. The developer is renowned for its outstanding schemes based on great design, a commitment to quality, an understanding of local needs and a desire to create positive change. &nbsp;MRMU Ltd was set up by Mark Upton in 2004. Mark is an expert in his field with over 20 years experience of acquiring and developing property in the commercial sector.&nbsp;MRMU works with a wide network of trusted partner consultants and this gives the company the ability to take on a diverse range of projects.</p>\n<p style=\"text-align: justify;\">Mziuri Gardens is the first British direct investment in Ajara region and will definitely&nbsp; contribute to the tourism development&nbsp; in the region and creation of new jobs.&nbsp;</p>', NULL, NULL, 0, 'about-us', NULL, 0, 1, 'https://mziurigardens.ge/files/about/about-mrmu.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'gardens, mziuri', 'About us', 0, NULL),
(368, 2, 0, 1, '2019-03-27 14:58:28', '2019-08-14 14:02:53', 5, 'ru', 1, 1, 'Инвестор', 'Инвестор', NULL, '<p style=\"text-align: justify;\">Разработчиком и инвестором проекта &laquo;Мзиури Гарденс&raquo; является британская компания &laquo;<a href=\"https://www.mrmultd.com/\" target=\"_blank\">MRMU</a>&raquo;, которая имеет большой опыт реализации крупномасштабных проектов на международном уровне. Разработчик известен своими великолепными дизайнерскими решениями, приверженностью качеству, пониманием местных потребностей и стремлением к позитивным изменениям. &laquo;MRMU &nbsp;Ltd&raquo; была основана Марком Аптоном в 2004 году. Марк является экспертом в своей области с более чем 20-летним опытом приобретения и развития недвижимости в коммерческом секторе. &laquo;MRMU&raquo; работает с широкой сетью доверенных партнеров и консультантов, что дает компании возможность реализовывать свои проекты на высочайшем уровне.</p>\n<p style=\"text-align: justify;\">Свою деятельность в Грузии &laquo;MRMU&raquo; начинает со строительства &laquo;Мзиури Гарденс&raquo;. Важно отметить, что проект &laquo;Мзиури Гарденс&raquo; является первой прямой британской инвестицией в Аджарии. Исходя из своих масштабов, он сыграет важную роль в деле привлечения в регион туристов и увеличению количества рабочих мест.</p>', NULL, NULL, 0, 'about-us', NULL, 0, 1, 'https://mziurigardens.ge/files/about/about-mrmu.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, Инвестор', 'Инвестор', 0, NULL),
