(390, 10, 4, 2, '2019-03-29 14:23:21', '2019-08-14 14:02:53', 10, 'ge', 1, 1, 'აღწერა', 'აღწერა', NULL, '<p>მზიური გარდენსი ახალი უნიკალური პროექტია კურორტ მახინჯაურში, რომლის მშენებლობაც ზღვიდან სულ რამოდენიმე მეტრში, ყოფილი სანატორიუმის ტერიტორიაზე მიმდინარეობს. მულტიფუნქციური კომპლექსის ტერიტორია 15 000 კვ.მ-ზე იქნება გაშენებული, საიდანაც&nbsp;უდიდესი&nbsp;ნაწილი უშუალოდ რეკრეაციულ ზონას და გამწვანებას დაეთმობა. კომპლექსის რეზიდენტებს წვდომა ექნებათ 5 ვარსკვლავიანი სასტუმროს, ინფრასტრუქტურასა და სერვისებთან.</p>', NULL, NULL, 0, 'project/description', NULL, 0, 1, 'https://mziurigardens.ge/files/project/bg-1.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'complex, აღწერა', 'აღწერა - Mziuri Gardens is a new residential complex currently under construction in resort Makhinjauri few steps away from the Black Sea beach', 0, NULL),
(391, 10, 4, 2, '2019-03-29 14:23:21', '2019-08-14 14:02:53', 10, 'en', 1, 1, 'Description', 'Description', NULL, '<p>Mziuri Gardens is a new residential complex currently under construction in resort Makhinjauri few steps away from the Black Sea beach. The area of the complex stretches over 15 000 sq.m. major part out of which will be allocated to lush green garden with century-old pine trees and other endemic plants.</p>', NULL, NULL, 0, 'project/description', NULL, 0, 1, 'https://mziurigardens.ge/files/project/bg-1.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'complex, description', 'Description - Mziuri Gardens is a new residential complex currently under construction in resort Makhinjauri few steps away from the Black Sea beach', 0, NULL),
(392, 10, 4, 2, '2019-03-29 14:23:21', '2019-08-14 14:02:53', 10, 'ru', 1, 1, 'Описание', 'Описание', NULL, '<p>&laquo;Мзиури Гарденс&raquo; - новый уникальный проект на курорте Махинджаури, строительство которого ведется в нескольких метрах от моря, на месте бывшего санатория. Территория нового мультифункционального комплекса &ndash; 15 000 кв/м,&nbsp;большинство территории которого будет отведено под озеленение и рекреационную зону.</p>', NULL, NULL, 0, 'project/description', NULL, 0, 1, 'https://mziurigardens.ge/files/project/bg-1.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'complex, Описание', 'Описание - Mziuri Gardens is a new residential complex currently under construction in resort Makhinjauri few steps away from the Black Sea beach', 0, NULL),
