(415, 20, 4, 2, '2019-03-29 14:37:54', '2019-08-14 14:02:53', 20, 'ge', 1, 1, 'შესახებ', 'შესახებ', NULL, '<p>პროექტი მოიცავს სამ 11-სართულიან შენობას, რომელთაგან ერთ-ერთში განთავსებული იქნება 5 ვარსკვლავიანი&nbsp; სასტუმრო.&nbsp; პროექტის მომზადების პროცესში მაქსიმალურად იქნა გათვალისწინებული ადგილობრივი ლანდშაფტის თავისებურებები და აქცენტი მის შენარჩუნებაზე გაკეთდა. აღსანიშნავია, რომ მზიური გარდენსში შენობის ყველა სართული და მთლიანი სივრცე სრულად ადაპტირებული იქნება.</p>', NULL, NULL, 0, 'project/about', NULL, 0, 1, 'https://mziurigardens.ge/files/project/about-mziuri-gardens-3.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'nbsp', 'შესახებ - პროექტი მოიცავს სამ 11-სართულიან კორპუსს, რომელთაგან ერთ-ერთში განთავსებული იქნება სასტუმრო კომპლექსი. პროექტის მომზადების პროცესში მაქსიმალურად იქნა გათვალისწინებული ადგილობრივი ლანდშაფტის თავისებურებები და აქცენტი მის შენარჩუნებაზე გაკეთდა', 0, NULL),
