(421, 22, 21, 3, '2019-03-29 14:40:09', '2019-08-14 14:02:53', 22, 'ge', 1, 1, 'ჯანსაღი გარემო', 'ჯანსაღი გარემო', NULL, '<p>მზიური გარდენსის საცხოვრებელ კომპლექსში შემავალი 12,000 კვ. მეტრზე გადაჭიმული რეკრეაციული ზონა, მთისა და ზღვის ჰაერის ნაზავთან ერთად უნიკალურ მიკროკლიმატს და ხარისხიანი ცხოვრებისა და დასვენებისათვის იდეალურ გარემოს ქმნის. აღსაღნიშნავია, რომ რეკრეაციული ზონის ნაწილი იქნება ფიჭვნარი და სხვა ენდემური ნარგავები, რომელიც უკვე წლებია ამშვენებს აქაურობას. აქვე უნდა აღინიშნოს, რომ კომპლექსის წინ მდებარე საბანაო ზოლი სუფთა ზღვის წყლით გამოირჩევა, რაც თალასოთერაპიისათვის საუკეთესო პირობებს ქნის.</p>', NULL, NULL, 0, 'project/advantages/healthy-environment', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'რეკრეაციული, ზღვის, ჯანსაღი, გარემო', 'მზიური გარდენსის საცხოვრებელ კომპლექსში შემავალი 10,000 კვ. მეტრზე გადაჭიმული რეკრეაციული ზონა, მთისა და ზღვის ჰაერის ნაზავთან ერთად უნიკალურ მიკროკლიმატს და ხარისხიანი ცხოვრებისა და დასვენებისათვის იდეალურ გარემოს ქმნის', 0, NULL),
(422, 22, 21, 3, '2019-03-29 14:40:09', '2019-08-14 14:02:53', 22, 'en', 1, 1, 'Healthy Environment', 'Healthy Environment', NULL, '<p>Lush greenery stretched over 12,000 sq.m. with century-old pine trees and other endemic plants, unique mixture of the sea and mountainous climates create perfect conditions for leading healthy lifestyle. At the same time, the beach and the sea water in front of Mziuri Gardens are clean creating wonderful opportunities for sunbathing and swimming.</p>', NULL, NULL, 0, 'project/advantages/healthy-environment', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'healthy, sea, environment', 'Healthy Environment - Lush greenery stretched over 10,000 sq.m. with century-old pine trees and other endemic plants, unique mixture of the sea and mountainous climates create perfect conditions for leading healthy lifestyle', 0, NULL),
(423, 22, 21, 3, '2019-03-29 14:40:09', '2019-08-14 14:02:53', 22, 'ru', 1, 1, 'Здоровая окружающая среда', 'Здоровая окружающая среда', NULL, '<p>Рекреационная зона жилого комплекса &laquo;Мзиури Гарденс&raquo; займёт 10 000 кв/м. Сочетая чистейший горный и морской воздух, а также уникальный микроклимат, она создаёт идеальные условия для качественной жизни и идеального отдыха. Особенно важно то, что часть рекреационной зоны будет занята многолетней сосновой рощей и другой эндемической растительностью. Также отметим, что находящаяся перед комплексом купальная зона, отличается чистой морской водой, создаёт отличные возможности для талассотерапии.</p>', NULL, NULL, 0, 'project/advantages/healthy-environment', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Здоровая, sea, среда, окружающая', 'Здоровая окружающая среда - Lush greenery stretched over 10,000 sq.m. with century-old pine trees and other endemic plants, unique mixture of the sea and mountainous climates create perfect conditions for leading healthy lifestyle', 0, NULL),
(424, 23, 21, 3, '2019-03-29 14:40:37', '2019-08-14 14:02:53', 23, 'ge', 1, 1, 'უნიკალური ადგილმდეობარეობა', 'უნიკალური ადგილმდეობარეობა', NULL, '<p>მულტიფუნქციური საცხოვრებელი კომპლექსი მზიური გარდენსი კურორტ მახინჯაურში, ბათუმის ცენტრიდან სულ რაღაც 6 კილომეტრში, ზღვის სანაპიროდან რამოდენიმე მეტრში მდებარეობს. აქ არსებული მინერალური წყლებისა და კლიმატური პირობების წყალობით XX საუკუნის დასაწყისიდან მახინჯაურს აქტიურად იყენებენ, როგორც კლიმატურ-ბალნეოლოგიურ კურორტს. ბათუმის ერთ-ერთი ყველაზე ვიზიტირებადი და მწვანე ადგილი, ბოტანიკური ბაღი მზიური გარდენსიდან სულ რაღაც 2 კილომეტრში მდებარეობს.</p>', NULL, NULL, 0, 'project/advantages/unique-location', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'მდებარეობს, ბათუმის, რაღაც, კილომეტრში, მზიური, უნიკალური, ადგილმდეობარეობა', 'უნიკალური ადგილმდეობარეობა - მულტიფუნქციური საცხოვრებელი კომპლექსი მზიური გარდენსი კურორტ მახინჯაურში, ბათუმის ცენტრიდან სულ რაღაც 6 კილომეტრში, ზღვის სანაპიროდან რამოდენიმე მეტრში მდებარეობს', 0, NULL),
(425, 23, 21, 3, '2019-03-29 14:40:37', '2019-08-14 14:02:53', 23, 'en', 1, 1, 'Unique location', 'Unique location', NULL, '<p>Multifunctional residential complex Mziuri Gardens is located in a resort Makhinjauri, 6 km. away from Batumi city center, few meters from the Black Sea beach. Thanks to its unique climate and mineral waters found here, Makhinjauri has been famed as a resort sine the 20th century. One of the greenest and the most visited places, Batumi Botanical Gardens, is just 2 km. away too.</p>', NULL, NULL, 0, 'project/advantages/unique-location', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'unique, resort, makhinjauri, away, gardens, batumi, location', 'Unique location - Multifunctional residential complex Mziuri Gardens is located in a resort Makhinjauri, 6 km. away from Batumi city center, few meters from the Black Sea beach', 0, NULL),
(426, 23, 21, 3, '2019-03-29 14:40:37', '2019-08-14 14:02:53', 23, 'ru', 1, 1, 'Уникальное расположение', 'Уникальное расположение', NULL, '<p>Мультифункциональный жилой комплекс &laquo;Мзиури Гарденс&raquo;, расположен всего в 6 км от центра Батуми, в нескольких метрах от морского побережья. Наличие лечебных термальных источников и уникальный микроклимат Махинджаруи, позволили ему уже с самого начала 20 века активно развиваться в качестве бальнеологического и климатического курорта. Всего лишь в 2 км от &laquo;Мзиури Гарденс&raquo; находится Батумский ботанический сад &ndash; уникальное, и одно из самых посещаемых мест Батуми.</p>', NULL, NULL, 0, 'project/advantages/unique-location', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Мзиури, raquo, Уникальное, Батуми, laquo, Гарденс, расположение', 'Уникальное расположение - Мультифункциональный жилой комплекс &laquo;Мзиури Гарденс&raquo;, расположен всего в 6 км от центра Батуми, в нескольких метрах от морского побережья', 0, NULL),
(427, 24, 21, 3, '2019-03-29 14:41:01', '2019-08-14 14:02:53', 24, 'ge', 1, 1, 'პანორამული ხედები ', 'პანორამული ხედები ', NULL, '<p>გამორჩეული ლოკაციის წყალობით მზიური გარდენსის მულტიფუნქიური საცხოვრებლის ყველა ფანჯრიდან ზღვის ულამაზესი პანორამული ხედები იშლება, რომლით ტკბობას არაფერი უშლის წინ ხელს. არანაკლებ სასიამოვნო და მიმზიდველი ხედები იშლება ასევე მთის მხარეს.</p>', NULL, NULL, 0, 'project/advantages/panoramic-views', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'ხედები, პანორამული, იშლება', 'გამორჩეული ლოკაციის წყალობით მზიური გარდენსის მულტიფუნქიური საცხოვრებლის ყველა ფანჯრიდან ზღვის ულამაზესი პანორამული ხედები იშლება, რომლით ტკბობას არაფერი უშლის წინ ხელს', 0, NULL),
(428, 24, 21, 3, '2019-03-29 14:41:01', '2019-08-14 14:02:53', 24, 'en', 1, 1, 'Panoramic views', 'Panoramic views', NULL, '<p>Each flat in Mziuri Gardens features amazing unrestricted panoramic views directly on the sea as well as beautiful mountains.</p>', NULL, NULL, 0, 'project/advantages/panoramic-views', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'panoramic, views', 'Each flat in Mziuri Gardens features amazing unrestricted panoramic views directly on the sea as well as beautiful mountains.', 0, NULL),
(429, 24, 21, 3, '2019-03-29 14:41:01', '2019-08-14 14:02:53', 24, 'ru', 1, 1, 'Панорамные виды', 'Панорамные виды', NULL, '<p>Благодаря своему особенному местоположению, из всех окон мультифункционального комплекса &laquo;Мзиури Гарденс&raquo;, открываются красивейшие панорамы моря. Перед комплексом нет ни одного строения, поэтому наслаждаться видами Вам ничего мешать не будет! Не менее живописные панорамы открываются и со стороны гор.</p>', NULL, NULL, 0, 'project/advantages/panoramic-views', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Панорамные, виды', 'Панорамные виды - Each flat in Mziuri Gardens features amazing unrestricted panoramic views directly on the sea as well as beautiful mountains.', 0, NULL),
(430, 25, 21, 3, '2019-03-29 14:41:19', '2019-08-14 14:02:53', 25, 'ge', 1, 1, 'წვდომა 5 * ინფრასტრუქტურასა და სერვისებთან ', 'წვდომა 5 * ინფრასტრუქტურასა და სერვისებთან ', NULL, '<p>მზიური გარდენსის მაცხოვრებლებს წვდომა ექნებათ 5 ვარსკვლავიანი სასტუმროს, მრავალფეროვან ინფრასტრუქტურასა და სერვისებთან, რომელიც ყველანაირ პირობას ქმნის აქტიური დასვენებისა თუ რელაქსაციისთვის, როგორც ზრდასრულებისთვის, ასევე პატარებისთვის.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', NULL, NULL, 0, 'project/advantages/diversity-of-facilities-and-amenities', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'მრავალფეროვანი, all, სერვისები, ინფრასტრუქტურა', 'მრავალფეროვანი ინფრასტრუქტურა და სერვისები - Mziuri Gardens boasts diverse range of facilities and amenities and services available on the premises of the complex which create all conditions for resting or having fun for people of all ages.', 0, NULL),
(431, 25, 21, 3, '2019-03-29 14:41:19', '2019-08-14 14:02:53', 25, 'en', 1, 1, 'Diversity of facilities and amenities', 'Diversity of facilities and amenities', NULL, '<p>Mziuri Gardens boasts diverse range of facilities and amenities and services available on the premises of the complex which create all conditions for resting or having fun for people of all ages.</p>', NULL, NULL, 0, 'project/advantages/diversity-of-facilities-and-amenities', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'facilities, amenities, all, diversity', 'Mziuri Gardens boasts diverse range of facilities and amenities and services available on the premises of the complex which create all conditions for resting or having fun for people of all ages.', 0, NULL),
(432, 25, 21, 3, '2019-03-29 14:41:19', '2019-08-14 14:02:53', 25, 'ru', 1, 1, 'Разнообразная инфраструктура и сервисы', 'Разнообразная инфраструктура и сервисы', NULL, '<p>Уникальная особенность жилого комплекса &laquo;Мзиури Гарденс&raquo; - разнообразие доступной на месте инфраструктуры и сервисов, что создаёт все условия для активного отдыха и релаксаций, как для взрослых так и для детей.</p>', NULL, NULL, 0, 'project/advantages/diversity-of-facilities-and-amenities', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Разнообразная, all, сервисы, инфраструктура', 'Разнообразная инфраструктура и сервисы - Mziuri Gardens boasts diverse range of facilities and amenities and services available on the premises of the complex which create all conditions for resting or having fun for people of all ages.', 0, NULL),
(433, 26, 21, 3, '2019-03-29 14:42:01', '2019-08-14 14:02:53', 26, 'ge', 1, 1, 'უსაფრთხო გარემო ', 'უსაფრთხო გარემო ', NULL, '<p>მზიური გარდენსის მაცხოვრებელთათვის უსაფრთხო და დაცული გარემოს შექმნას ვუზრუნველყოფთ. სახანძრო უსაფრთხოების ნორმები სრულ შესაბამისობაში იქნება საქართველოს მთავრობის 41-ე დადგენილებით გათვალისწინებულ მოთხოვნებთან, რომელიც შენობა-ნაგებობის უსაფრთხოების ნორმებს განსაზღვრავს. უსაფრთხოების დაცვა ასევე მოხდება 24/7 ვიდეო კონტროლისა და ცოცხალი დაცვის საშუალებით.</p>', NULL, NULL, 0, 'project/advantages/safe-environment', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'გარემო, უსაფრთხო', 'უსაფრთხო გარემო  - In Mziuri Gardens we ensure to create safe environment for our residents. Fire safety norms will be in full compliance with the resolution 41 of the Georgian government', 0, NULL),
(434, 26, 21, 3, '2019-03-29 14:42:01', '2019-08-14 14:02:53', 26, 'en', 1, 1, 'Safe Environment', 'Safe Environment', NULL, '<p>In Mziuri Gardens we ensure to create safe environment for our residents. Fire safety norms will be in full compliance with the resolution 41 of the Georgian government. In addition, 24/7 onsite video surveillance and guards will provide extra sectary.</p>', NULL, NULL, 0, 'project/advantages/safe-environment', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'environment, safe', 'Safe Environment - In Mziuri Gardens we ensure to create safe environment for our residents. Fire safety norms will be in full compliance with the resolution 41 of the Georgian government', 0, NULL),
(435, 26, 21, 3, '2019-03-29 14:42:01', '2019-08-14 14:02:53', 26, 'ru', 1, 1, 'Безопасность', 'Безопасность', NULL, '<p>Мы обеспечиваем всем жителям &laquo;Мзиури Гарденс&raquo; безопасный отдых и обстановку. Нормы пожарной безопасности будут полностью соответствовать постановлению правительства Грузии за номером 41, определяющим нормы пожарной безопасности в зданиях. Также безопасность в течение 24 часов будет обеспечена с помощью видеонаблюдения и охраны.</p>', NULL, NULL, 0, 'project/advantages/safe-environment', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Безопасность', 'Безопасность - In Mziuri Gardens we ensure to create safe environment for our residents. Fire safety norms will be in full compliance with the resolution 41 of the Georgian government', 0, NULL),
(436, 27, 21, 3, '2019-03-29 14:42:20', '2019-08-14 14:02:53', 27, 'ge', 1, 1, 'ენერგოეფექტურობა ', 'ენერგოეფექტურობა ', NULL, '<p>შენობის ფასადი დამუშავებული იქნება სპეციალური თბო და ჰიდრო საიზოლაციო მასალით, რაც ერთის მხრივ ხელს უწყობს ენერგოეფექტურობას, ხოლო მეორეს მხრივ იცავს ფასადს წყლის შეღწევისგან და შესაბამისად ნესტის დაგროვებისგან. ასევე, მშენებლობის პროცესში გამოყენებული იქნება სპეციალური ენერგო-ეფექტური ბლოკი, რომელიც ამასთანავე ახდენს ხმის იზოლაციას.</p>', NULL, NULL, 0, 'project/advantages/energy-efficiency', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'ccedil, ade, building, ენერგოეფექტურობა, used, energy', 'ენერგოეფექტურობა  - Materials with thermal and hydro insulation will be used for the façade of the building of Mziuri Gardens preventing the water from penetration and protecting the façade from accumulating humidity', 0, NULL),
(437, 27, 21, 3, '2019-03-29 14:42:20', '2019-08-14 14:02:53', 27, 'en', 1, 1, 'Energy-efficiency', 'Energy-efficiency', NULL, '<p>Materials with thermal and hydro insulation will be used for the fa&ccedil;ade of the building of Mziuri Gardens preventing the water from penetration and protecting the fa&ccedil;ade from accumulating humidity. In addition, a special energy-efficient, soundproof blocks will be used for construction.</p>', NULL, NULL, 0, 'project/advantages/energy-efficiency', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'energy, efficiency, ccedil, used, ade, building', 'Energy-efficiency - Materials with thermal and hydro insulation will be used for the façade of the building of Mziuri Gardens preventing the water from penetration and protecting the façade from accumulating humidity', 0, NULL),
(438, 27, 21, 3, '2019-03-29 14:42:20', '2019-08-14 14:02:53', 27, 'ru', 1, 1, 'Энергоэффективность', 'Энергоэффективность', NULL, '<p>Фасад здания будет обработан специальным тепло и гидроизоляционным материалом, что с одной стороны будет способствовать обеспечению энергоэффективности, а с другой &ndash; защищать здание от проникновения воды и образования сырости. Также, в процессе строительства будут использованы специальные энергоэффективные блоки, которые параллельно обеспечат и звукоизоляцию.</p>', NULL, NULL, 0, 'project/advantages/energy-efficiency', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'ccedil, ade, building, Энергоэффективность, used, energy', 'Энергоэффективность - Materials with thermal and hydro insulation will be used for the façade of the building of Mziuri Gardens preventing the water from penetration and protecting the façade from accumulating humidity', 0, NULL),
(439, 28, 21, 3, '2019-03-29 14:43:44', '2019-08-14 14:02:53', 28, 'ge', 1, 1, 'უკუგების მიღების შესაძლებლობა ', 'უკუგების მიღების შესაძლებლობა ', NULL, '<p>მზიური გარდენსში ბინის შეძენით თქვენ არა მხოლოდ მყუდრო და ხარისხიან საცხოვრებელს იძენთ, არამედ გონივრულად ახდენთ ფულის ინვესტირებას. ბათუმი, როგორც შავიზღვისპირეთის ერთ-ერთი გამორჩეული ტურისტული დანიშნულების ადგილი ყოველწიურად მილიონობით ვიზიტორს მასპინძლობს. შესაბამისად ბინის გაქირავება სოლიდური შემოსავლის წყაროდ შეიძლება იქცეს. წლიური საშუალო დატვირთულობა 60-70 %-ს აღწევს, რაც შესაძლებლობას მოგცემთ ინვესტირებული თანხები 3 დან 5 წლამდე ვადაში დაიბრუნოთ უკან. სურვილის შემთხვევაში მზად ვართ ბინის გაქირავება ჩვენი მობინადრეებისთვის ჩვენს თავზე ავიღოთ.</p>', NULL, NULL, 0, 'project/advantages/payback', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'ბინის, უკუგების, გაქირავება, მიღების, შესაძლებლობა', 'უკუგების მიღების შესაძლებლობა  - მზიური გარდენსში ბინის შეძენით თქვენ არა მხოლოდ მყუდრო და ხარისხიან საცხოვრებელს იძენთ, არამედ გონივრულად ახდენთ ფულის ინვესტირებას', 0, NULL),
(440, 28, 21, 3, '2019-03-29 14:43:44', '2019-08-14 14:02:53', 28, 'en', 1, 1, 'Payback', 'Payback', NULL, '<p>Purchasing a flat in Mziuri Gardens is also a smart investment. Batumi as a leading tourism destination on the Black Sea is hosting millions of visitors each year. With average occupancy rate reaching 60-70%, renting out a flat in Batumi can be a good source for earning some additional income. Furthermore, you can achieve a payback within 3-5 years. The management of Mziuri Gardens is ready to take care of all rent-related issues on behalf of our residents.</p>', NULL, NULL, 0, 'project/advantages/payback', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'payback, batumi, gardens, can, flat, mziuri', 'Payback - Purchasing a flat in Mziuri Gardens is also a smart investment. Batumi as a leading tourism destination on the Black Sea is hosting millions of visitors each year', 0, NULL),
(441, 28, 21, 3, '2019-03-29 14:43:44', '2019-08-14 14:02:53', 28, 'ru', 1, 1, 'Окупаемость', 'Окупаемость', NULL, '<p>Купив квартиру в &laquo;Мзиури Гарденс&raquo;, вы приобретёте не только уютное и качественное жилье, но и грамотно вложите деньги. Батуми, как одно из перспективнейших туристических направлений на Черноморском побережье, принимает миллионы посетителей каждый год. Соответственно, аренда квартиры может стать источником солидного дохода. Среднегодовая загруженность доходит до 60-70%, что позволит вернуть вложенные в покупку квартиры деньга за 3-5 лет. При желании, мы готовы помочь нашим жильцам в организации аренды квартир.</p>', NULL, NULL, 0, 'project/advantages/payback', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Окупаемость, batumi, can, gardens, mziuri, flat', 'Окупаемость - Purchasing a flat in Mziuri Gardens is also a smart investment. Batumi as a leading tourism destination on the Black Sea is hosting millions of visitors each year', 0, NULL),
(442, 29, 4, 2, '2019-03-29 14:44:21', '2019-08-14 14:02:53', 36, 'ge', 1, 1, 'უსაფრთხოება', 'უსაფრთხოება', NULL, '<p>მზიური გარდენსში ყველა საჭირო ზომა იქნება მიღებული საცხოვრებელ კომპლექსის ტერიტორიაზე უსაფრთხო და დაცული გარემოს შექმნისათვის.</p>', NULL, NULL, 0, 'project/safety-and-security', NULL, 0, 1, NULL, 'https://mziurigardens.ge/files/project/Safety-cover.jpg', NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, უსაფრთხოება', 'უსაფრთხოება', 0, NULL),
(443, 29, 4, 2, '2019-03-29 14:44:21', '2019-08-14 14:02:53', 36, 'en', 1, 1, 'Safety and Security', 'Safety and Security', NULL, '<p>In Mziuri Gardens we take all necessary measures to provide safe and secure environment for our residents.</p>', NULL, NULL, 0, 'project/safety-and-security', NULL, 0, 1, NULL, 'https://mziurigardens.ge/files/project/Safety-cover.jpg', NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, security, safety', 'Safety and Security', 0, NULL),
(444, 29, 4, 2, '2019-03-29 14:44:21', '2019-08-14 14:02:53', 36, 'ru', 1, 1, 'Безопасность', 'Безопасность', NULL, '<p>В &laquo;Мзиури Гарденс&raquo; будут предусмотрены все необходимые меры для обеспечения безопасности на территории комплекса.</p>', NULL, NULL, 0, 'project/safety-and-security', NULL, 0, 1, NULL, 'https://mziurigardens.ge/files/project/Safety-cover.jpg', NULL, NULL, NULL, NULL, 0, 'Безопасность', 'Безопасность - В «Мзиури Гарденс» будут предусмотрены все необходимые меры для обеспечения безопасности на территории комплекса.', 0, NULL),
(445, 30, 29, 3, '2019-03-29 14:48:25', '2019-08-14 14:02:53', 30, 'ge', 1, 1, 'სახანძრო უსაფრთხოება ', 'სახანძრო უსაფრთხოება ', NULL, '<p>სახანძრო უსაფრთხოების ნორმები სრულ შესაბამისობაში იქნება საქართველოს მთავრობის 41-ე დადგენილებით გათვალისწინებულ მოთხოვნებთან, რომელიც შენობა-ნაგებობის უსაფრთხოების ნორმებს განსაზღვრავს.</p>', NULL, NULL, 0, 'project/safety-and-security/fire-safety', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'სახანძრო, უსაფრთხოება', 'სახანძრო უსაფრთხოება  - Fire safety norms will be in full compliance with the resolution 41 of the Georgian government.', 0, NULL),
(446, 30, 29, 3, '2019-03-29 14:48:25', '2019-08-14 14:02:53', 30, 'en', 1, 1, 'Fire Safety', 'Fire Safety', NULL, '<p>Fire safety norms will be in full compliance with the resolution 41 of the Georgian government.</p>', NULL, NULL, 0, 'project/safety-and-security/fire-safety', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'fire, safety', 'Fire safety norms will be in full compliance with the resolution 41 of the Georgian government.', 0, NULL),
(447, 30, 29, 3, '2019-03-29 14:48:25', '2019-08-14 14:02:53', 30, 'ru', 1, 1, 'Пожарная безопасность', 'Пожарная безопасность', NULL, '<p>Нормы пожарной безопасности будут полностью соответствовать постановлению правительства Грузии за номером 41, которое определяет нормы пожарной безопасности в зданиях.</p>', NULL, NULL, 0, 'project/safety-and-security/fire-safety', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Пожарная, пожарной, безопасности, безопасность', 'Пожарная безопасность - Нормы пожарной безопасности будут полностью соответствовать постановлению правительства Грузии за номером 41, которое определяет нормы пожарной безопасности в зданиях.', 0, NULL),
(448, 31, 29, 3, '2019-03-29 14:48:41', '2019-08-14 14:02:53', 31, 'ge', 1, 1, 'ხანძარსაწინააღმდეგო სისტემა', 'ხანძარსაწინააღმდეგო სისტემა', NULL, '<p>მზიურის გარდენსის კომპლექსში განთავსებული იქნება ხანძრის მართვის ოთახი, საიდანაც მოხდება უსაფრთხოების ყველა ღონისძების გატარება და კონტროლი. ამასთანავე ყველა სართულის აღჭურვა მოხდება კვამლის დეტექტორებით.</p>', NULL, NULL, 0, 'project/safety-and-security/fire-safety-system', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'ხანძარსაწინააღმდეგო, all, სისტემა', 'ხანძარსაწინააღმდეგო სისტემა - Fire control room located in Mziuri Gardens enables to take all necessary measures for ensuring safety. At the same time, all floors will be equipped with smoke detectors.', 0, NULL),
(449, 31, 29, 3, '2019-03-29 14:48:41', '2019-08-14 14:02:53', 31, 'en', 1, 1, 'Fire safety system', 'Fire safety system', NULL, '<p>Fire control room located in Mziuri Gardens enables to take all necessary measures for ensuring safety. At the same time, all floors will be equipped with smoke detectors.</p>', NULL, NULL, 0, 'project/safety-and-security/fire-safety-system', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'fire, safety, all, system', 'Fire control room located in Mziuri Gardens enables to take all necessary measures for ensuring safety. At the same time, all floors will be equipped with smoke detectors.', 0, NULL),
(450, 31, 29, 3, '2019-03-29 14:48:41', '2019-08-14 14:02:53', 31, 'ru', 1, 1, 'Система пожарной безопасности', 'Система пожарной безопасности', NULL, '<p>В комплексе &laquo;Мзиури Гарденс&raquo; будет функционировать специальная комната по управлению пожарной безопасностью, через которую будет осуществляться контроль, и проводиться все мероприятия по обеспечению безопасности. Вместе с тем, на всех этажах комплекса будут установлены детекторы задымления.</p>', NULL, NULL, 0, 'project/safety-and-security/fire-safety-system', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'all, Система, безопасности, пожарной', 'Система пожарной безопасности - Fire control room located in Mziuri Gardens enables to take all necessary measures for ensuring safety. At the same time, all floors will be equipped with smoke detectors.', 0, NULL),
(451, 32, 29, 3, '2019-03-29 14:48:55', '2019-08-14 14:02:53', 32, 'ge', 1, 1, 'ცეცხლგამძლე სამშენებლო მასალა ', 'ცეცხლგამძლე სამშენებლო მასალა ', NULL, '<p>შენობის ძირითად ნაწილებში იატაკების და კედლების მოწყობა ცეცხლგამძლე მასალებით მოხდება.</p>', NULL, NULL, 0, 'project/safety-and-security/fire-resistant-construction-material', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'მასალა, სამშენებლო, ცეცხლგამძლე', 'ცეცხლგამძლე სამშენებლო მასალა  - Floors and walls in the main parts of the building will be faced with fire resistant materials.', 0, NULL),
