(457, 34, 29, 3, '2019-03-29 14:49:39', '2019-08-14 14:02:53', 34, 'ge', 1, 1, 'სახანძრო კიბის უჯრედი ', 'სახანძრო კიბის უჯრედი ', NULL, '<p>მზიური გარდენსის კომპლექსში შემავალ თითეულ ბლოკში ასევე მოეწყობა ორ-ორი სახანძრო კიბის უჯრედი, რომელიც ცეცხლგამძლე სამშენებლო მასალებით და კარებით იქნება აღჭურვილი.</p>', NULL, NULL, 0, 'project/safety-and-security/fire-escape', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'fire, სახანძრო, უჯრედი, კიბის', 'სახანძრო კიბის უჯრედი  - Each building in the complex of Mziuri Gardens will have fire escapes faced with fire resistant materials.', 0, NULL),
