(459, 34, 29, 3, '2019-03-29 14:49:39', '2019-08-14 14:02:53', 34, 'ru', 1, 1, 'Пожарная безопасность лестничных клеток', 'Пожарная безопасность лестничных клеток', NULL, '<p>Каждый блок, входящий в комплекс &laquo;Мзиури Гарденс&raquo; будет оснащён двумя пожарными лестничными клетками и дверями из огнеупорных материалов.</p>', NULL, NULL, 0, 'project/safety-and-security/fire-escape', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'fire, клеток, лестничных, Пожарная, безопасность', 'Пожарная безопасность лестничных клеток - Each building in the complex of Mziuri Gardens will have fire escapes faced with fire resistant materials.', 0, NULL),
(460, 35, 29, 3, '2019-03-29 14:49:55', '2019-08-14 14:02:53', 35, 'ge', 1, 1, 'დაცული პერიმეტრი ', 'დაცული პერიმეტრი ', NULL, '<p>მზიური გარდენისის მუტლიფუნქტიური კომპლექსის ტერიტორიაზე უსაფრთხოების დაცვა ასევე მოხდება 24/7 ვიდეო კონტროლისა და ცოცხალი დაცვის საშუალებით.</p>', NULL, NULL, 0, 'project/safety-and-security/extra-security', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'დაცული, პერიმეტრი', 'დაცული პერიმეტრი  - მზიური გარდენისის მუტლიფუნქტიური კომპლექსის ტერიტორიაზე უსაფრთხოების დაცვა ასევე მოხდება 24/7 ვიდეო კონტროლისა და ცოცხალი დაცვის საშუალებით.', 0, NULL),
