(462, 35, 29, 3, '2019-03-29 14:49:55', '2019-08-14 14:02:53', 35, 'ru', 1, 1, 'Защищённый периметр', 'Защищённый периметр', NULL, '<p>Обеспечение безопасности на территории мультифункционального комплекса &laquo;Мзиури Гарденс&raquo;, будет осуществляться при помощи круглосуточного видеоконтроля и охраны.</p>', NULL, NULL, 0, 'project/safety-and-security/extra-security', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Защищённый, периметр', 'Защищённый периметр - Обеспечение безопасности на территории мультифункционального комплекса &laquo;Мзиури Гарденс&raquo;, будет осуществляться при помощи круглосуточного видеоконтроля и охраны.', 0, NULL),
(463, 36, 4, 2, '2019-03-29 14:50:22', '2019-08-14 14:02:53', 48, 'ge', 1, 1, 'ინფრასტრუქტურა', 'ინფრასტრუქტურა', NULL, '<p>წვდომა 5 ვარსკვლავიანი სასტუმროს, Crowne Plaza-ს ინფრასტრუქტურასა და სერვისებთან.&nbsp;</p>', NULL, NULL, 0, 'project/facilities-and-amenities', NULL, 0, 1, NULL, 'https://mziurigardens.ge/files/project/Facilities-cover.jpg', NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, ინფრასტრუქტურა', 'ინფრასტრუქტურა', 0, NULL),
