(466, 37, 36, 3, '2019-03-29 14:50:34', '2019-08-14 14:02:53', 37, 'ge', 1, 1, 'სპა და ფიტნეს ცენტრი', 'სპა და ფიტნეს ცენტრი', NULL, '<p>კომპლექსის ტერიტორიაზე არსებული სპა და ფიტნეს ცენტრი გაჯანსაღებისა თუ რელაქსაციისთვის იდეალურ გარემოს გპირდებათ, რაშიც შედის ჯაკუზი, მასაჟის ოთახი, საუნა და სავარჯიშო დარბაზი. ასევე, კომპლექსის ტერიტორიაზე მოწყობა ღია და დახურული აუზები.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/spa-and-fitness-center', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'ცენტრი, ფიტნეს, სპა, ტერიტორიაზე, კომპლექსის', 'კომპლექსის ტერიტორიაზე არსებული სპა და ფიტნეს ცენტრი გაჯანსაღებისა თუ რელაქსაციისთვის იდეალურ გარემოს გპირდებათ, რაშიც შედის ჯაკუზი, მასაჟის ოთახი, საუნა და სავარჯიშო დარბაზი', 0, NULL),
(467, 37, 36, 3, '2019-03-29 14:50:34', '2019-08-14 14:02:53', 37, 'en', 1, 1, 'Spa and fitness center', 'Spa and fitness center', NULL, '<p>A spa and fitness center located on the premises of Mziuri Gardens promises perfect conditions for relaxation and rejuvenation. The center consists of Jacuzzi, a massage room, a sauna, and a fitness room. In addition, open and closed swimming pools will be at disposal of our residents.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/spa-and-fitness-center', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'center, fitness, spa, room', 'A spa and fitness center located on the premises of Mziuri Gardens promises perfect conditions for relaxation and rejuvenation. The center consists of Jacuzzi, a massage room, a sauna, and a fitness room', 0, NULL),
(468, 37, 36, 3, '2019-03-29 14:50:34', '2019-08-14 14:02:53', 37, 'ru', 1, 1, 'Спа и фитнес-центр', 'Спа и фитнес-центр', NULL, '<p>Спа и фитнес-центр, находящиеся на территории комплекса &laquo;Мзиури Гарденс&raquo;, создают идеальные условия для релаксации и оздоровления. Сюда входят джакузи, массажная комната, сауна, спортзал. Также, на территории комплекса предполагается разместить открытый и закрытый бассейны.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/spa-and-fitness-center', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'center, Спа, room, fitness, фитнес, центр', 'Спа и фитнес-центр - A spa and fitness center located on the premises of Mziuri Gardens promises perfect conditions for relaxation and rejuvenation. The center consists of Jacuzzi, a massage room, a sauna, and a fitness room', 0, NULL),
(469, 38, 36, 3, '2019-03-29 14:50:51', '2019-08-14 14:02:53', 38, 'ge', 1, 1, 'კეთილმოწყობილი ეზო ', 'კეთილმოწყობილი ეზო ', NULL, '<p>მზიური გარდენსის უზარმაზარი ეზო ჰამაკებით, პუფებით, ბალიშებით და რბილი ავეჯით იქნება კეთილმოწყობილი, რომელიც იდეალური ადგილი იქნება განტვირთვისთვის და მეზობლებთან სოციალიზაციისთვის. ასევე, ეზოს ტერიტორიაზე მოეწყობა კალათბურთის მოედანი, საზაფხულო ამფითეატრი, დამონტაჟდება საცოცი კედელი, დაიდგმება გიგანტური ჭადრაკის დაფა.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/well-equipped-yard', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'ეზო, კეთილმოწყობილი', 'მზიური გარდენსის უზარმაზარი ეზო ჰამაკებით, პუფებით, ბალიშებით და რბილი ავეჯით იქნება კეთილმოწყობილი, რომელიც იდეალური ადგილი იქნება განტვირთვისთვის და მეზობლებთან სოციალიზაციისთვის', 0, NULL),
(470, 38, 36, 3, '2019-03-29 14:50:51', '2019-08-14 14:02:53', 38, 'en', 1, 1, 'Well-equipped yard', 'Well-equipped yard', NULL, '<p>A huge green yard of Mziuri Gardens will be equipped with hammocks, bean bags and other soft furniture enabling you to relax and socialize with other neighbors in a serene environment. In addition, the yard will feature a basketball court, a summer amphitheater, a climbing wall, a giant chess board.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/well-equipped-yard', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'yard, equipped, other, well', 'A huge green yard of Mziuri Gardens will be equipped with hammocks, bean bags and other soft furniture enabling you to relax and socialize with other neighbors in a serene environment', 0, NULL),
(471, 38, 36, 3, '2019-03-29 14:50:51', '2019-08-14 14:02:53', 38, 'ru', 1, 1, 'Благоустроенный двор', 'Благоустроенный двор', NULL, '<p>Обширный, благоустроенный двор &laquo;Мзиури Гарденс&raquo; - идеальное место для расслабления, отдыха и общения. В нём будут размещены гамаки, пуфы, мягкая мебель, а также баскетбольная площадка, летний амфитеатр, скалолазная стенка и доска для гигантских шахмат.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/well-equipped-yard', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'other, Благоустроенный, yard, двор', 'Благоустроенный двор - A huge green yard of Mziuri Gardens will be equipped with hammocks, bean bags and other soft furniture enabling you to relax and socialize with other neighbors in a serene environment', 0, NULL),
(472, 39, 36, 3, '2019-03-29 14:51:09', '2019-08-14 14:02:53', 39, 'ge', 1, 1, 'კეთილმოწყობილი პლაჟი', 'კეთილმოწყობილი პლაჟი', NULL, '<p>მზიური გარდენსის კომპლექსი ზღვიდან სულ რამოდენიმე ნაბიჯში იქნება განთავსებული. მზიური გარდენისის მაცხოვრებლები პლაჟზე პირდაპირ გადასვლას სპეციალურად მოწყობილი ხიდის და ლიფტის მეშვეობით შეძლებენ, სადაც მათ დახვდებათ შეზლონგებით, ზღვის ქოლგებით, კაფე-ბარებით კეთილმოწყობილი პლაჟი. წყლის აქტივობების მოყვარულთათვის ხელმისაწვდომი იქნება სკუტერები, ბანანები, წყლის ველოსიპედები.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/private-beach', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'water, beach, საკუთარი, პლაჟი', 'საკუთარი პლაჟი  - Mziuri Gardens boasts prime seaside location just few steps away from the beach. Our residents will be able to access the beach via a specially built bridge and an installed elevator', 0, NULL),
(473, 39, 36, 3, '2019-03-29 14:51:09', '2019-08-14 14:02:53', 39, 'en', 1, 1, 'Well-arranged beach', 'Well-arranged beach', NULL, '<p>Mziuri Gardens boasts prime seaside location just few steps away from the beach. Our residents will be able to access the beach via a specially built bridge and an installed elevator. The beach will be equipped with deckchairs and parasols. Water activity lovers will have a chance to try water scooter, water bananas and water bicycles. An onsite caf&eacute; will provide refreshing drinks.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/private-beach', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'beach, water, private', 'Mziuri Gardens boasts prime seaside location just few steps away from the beach. Our residents will be able to access the beach via a specially built bridge and an installed elevator', 0, NULL),
(474, 39, 36, 3, '2019-03-29 14:51:09', '2019-08-14 14:02:53', 39, 'ru', 1, 1, 'хорошо обустроенный пляж', 'хорошо обустроенный пляж', NULL, '<p>Комплекс &laquo;Мзиури Гарденс&raquo; будет расположен в нескольких шагах от моря. Жильцы комплекса смогут попасть на пляж при помощи специально приспособленных для этого моста и лифта. На пляже их ждут шезлонги, солнечные зонтики, кафе-бары. Для любителей активного отдыха на море, в доступе будут скутера, водный &laquo;банан&raquo;, водный велосипед.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/private-beach', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'пляж, водный, Свой, raquo, laquo', 'Комплекс «Мзиури Гарденс» будет расположен в нескольких шагах от моря. Жильцы комплекса смогут попасть на пляж при помощи специально приспособленных для этого моста и лифта', 0, NULL),
(475, 40, 36, 3, '2019-03-29 14:51:26', '2019-08-14 14:02:53', 40, 'ge', 1, 1, 'საბავშვო ინფრაქსტურქტურა', 'საბავშვო ინფრაქსტურქტურა', NULL, '<p>მზიური გარდენსში განსაკუთრებულ ყურადღებას ბავშვებზე ზრუნვას ვუთმობთ. ამიტომაც, კომპლექსის ტერიტორიაზე გაშენდება სპეციალური სკვერი და სათამაშო მოედანი ბავშვებისთვის, მოეწყობა მინი აუზი, ეზოს და პლაჟის ტერიტორიაზე- სათამაშო ქვიშის მოედანი, დადგმება ბატუტები. ფიზიკურ აქტივობებთან ერთად, ბავშვებს შესაძლებლობა ექნებათ შეურთდნენ ადგილზე ორგანიზებულ ხატვის, ძერწვის, ცურვის, ინგლისურის გაკვეთილებს. წვიმიან ამინდებში ბავშვები გართობას მათთვის სპეციალურად მოწყობილ დახურულ სათამაშო ოთახში შეძლებენ.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/facilities-and-amenities-for-kids', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'kids, have, საბავშვო, ინფრაქსტურქტურა, swimming', 'საბავშვო ინფრაქსტურქტურა - In Mziuri Gardens we do care about children. Therefore, a special playground, mini swimming pools, sand playgrounds and a trampoline will be arranged for kids', 0, NULL),
(476, 40, 36, 3, '2019-03-29 14:51:26', '2019-08-14 14:02:53', 40, 'en', 1, 1, 'Facilities and amenities for kids', 'Facilities and amenities for kids', NULL, '<p>In Mziuri Gardens we do care about children. Therefore, a special playground, mini swimming pools, sand playgrounds and a trampoline will be arranged for kids. In addition to physical activities, kids will have also a chance to join onsite classes of drawing, swimming, English language and so on. In rainy days, kids will have fun at a closed play area.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/facilities-and-amenities-for-kids', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'kids, facilities, have, swimming, amenities', 'In Mziuri Gardens we do care about children. Therefore, a special playground, mini swimming pools, sand playgrounds and a trampoline will be arranged for kids', 0, NULL),
(477, 40, 36, 3, '2019-03-29 14:51:26', '2019-08-14 14:02:53', 40, 'ru', 1, 1, 'Детская инфраструктура', 'Детская инфраструктура', NULL, '<p>В &laquo;Мзиури Гарденс&raquo; мы особенно заботимся о детях. Именно поэтому, на территории комплекса будет специальный сквер и детская игровая площадка, мини-бассейн, батуты, а на территории двора и на пляже &ndash; песочницы. Вместе с физической активностью, дети смогут принять участие в организованных на месте уроках рисования, лепки, плавания, уроках английского языка. В дождливые дни дети могут развлечься в закрытых игровых комнатах.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/facilities-and-amenities-for-kids', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'kids, have, Детская, инфраструктура, swimming', 'Детская инфраструктура - In Mziuri Gardens we do care about children. Therefore, a special playground, mini swimming pools, sand playgrounds and a trampoline will be arranged for kids', 0, NULL),
(478, 41, 36, 3, '2019-03-29 14:51:43', '2019-08-14 14:02:53', 41, 'ge', 1, 1, 'რესტორნები და კაფე-ბარები ', 'რესტორნები და კაფე-ბარები ', NULL, '<p>გურმანებისთვის ჩვენი საცხოვრებელი კომპლექსი ნამდვილი სამოთხე იქნება. კომპლექსის ტერიტორიაზე განთავსებული იქნება 5 სხვადასხვა ტიპის რესტორანი, სადაც ქართული, ჩინური, იაპონური, ევროპული და ამერიკული სამზარეულოს დაგემოვნებას შეძლებთ. ასევე, ალკოჰოლური და არა ალკოჰოლური სასმელების ფართო არჩევანით გაგანებივრებთ ჩვენი ლაუნჯები და ბარები.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/restaurants-and-cafes', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'alcoholic, ბარები, რესტორნები, კაფე', 'რესტორნები და კაფე-ბარები  - For food lovers, Mziuri Gardens will be a real paradise. 5 different onsite restaurants will serve the Georgian, Chinese, Japanese, European and American cuisine', 0, NULL),
(479, 41, 36, 3, '2019-03-29 14:51:43', '2019-08-14 14:02:53', 41, 'en', 1, 1, 'Restaurants and cafes', 'Restaurants and cafes', NULL, '<p>For food lovers, Mziuri Gardens will be a real paradise. 5 different onsite restaurants will serve the Georgian, Chinese, Japanese, European and American cuisine. Our lounges and cafes will offer a wide choice of alcoholic and non-alcoholic drinks.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/restaurants-and-cafes', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'cafes, restaurants, alcoholic', 'For food lovers, Mziuri Gardens will be a real paradise. 5 different onsite restaurants will serve the Georgian, Chinese, Japanese, European and American cuisine', 0, NULL),
(480, 41, 36, 3, '2019-03-29 14:51:43', '2019-08-14 14:02:53', 41, 'ru', 1, 1, 'Рестораны и кафе-бары', 'Рестораны и кафе-бары', NULL, '<p>Наш жилой комплекс будет настоящим раем для гурманов. На его территории расположатся 5 ресторанов различного типа, где Вы сможете попробовать блюда грузинской, европейской, американской, китайской и японской кухни. Наши лаунджи и бары, предоставят широкий выбор алкогольных и безалкогольных напитков.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/restaurants-and-cafes', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'alcoholic, бары, Рестораны, кафе', 'Рестораны и кафе-бары - For food lovers, Mziuri Gardens will be a real paradise. 5 different onsite restaurants will serve the Georgian, Chinese, Japanese, European and American cuisine', 0, NULL),
(481, 42, 36, 3, '2019-03-29 14:52:00', '2019-08-14 14:02:53', 42, 'ge', 1, 1, 'საკონფერენციო დარბაზი ', 'საკონფერენციო დარბაზი ', NULL, '<p>დასვენებასთან ერთად, კომპლექსში ყველანაირი პირობა იქნება შექმნილი საქმიანი შეხვედრებისთვის. კერძოდ, კი მოეწყობა როგორც შიდა, დახურული საკონფერენციო დარბაზი, ასევე ეზოში გამოიყოფა სივრცე შეხვედრებისთვის.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/conference-room', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'meetings, საკონფერენციო, დარბაზი', 'საკონფერენციო დარბაზი  - Alongside with having rest and fun, Mziuri Gardens will provide facilities and enmities for holding business meetings. A closed and an open-air conference room will be set up for residents', 0, NULL),
(482, 42, 36, 3, '2019-03-29 14:52:00', '2019-08-14 14:02:53', 42, 'en', 1, 1, 'Conference room', 'Conference room', NULL, '<p>Alongside with having rest and fun, Mziuri Gardens will provide facilities and enmities for holding business meetings. A closed and an open-air conference room will be set up for residents. In addition, the space for meetings will be allocated in the yard as well.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/conference-room', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'room, conference, meetings', 'Alongside with having rest and fun, Mziuri Gardens will provide facilities and enmities for holding business meetings. A closed and an open-air conference room will be set up for residents', 0, NULL),
(483, 42, 36, 3, '2019-03-29 14:52:00', '2019-08-14 14:02:53', 42, 'ru', 1, 1, 'Конференц-зал', 'Конференц-зал', NULL, '<p>Помимо отдыха, в комплексе будут созданы все условия для деловых встреч. В частности, будут функционировать внутренний зал для конференций, и зал под открытым небом,для которого во дворе будет выделено специальное пространство.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/conference-room', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'зал, будут, Конференц', 'Конференц-зал - Помимо отдыха, в комплексе будут созданы все условия для деловых встреч. В частности, будут функционировать внутренний зал для конференций, и зал под открытым небом,для которого во дворе будет выделено специальное пространство.', 0, NULL),
(484, 43, 36, 3, '2019-03-29 14:52:17', '2019-08-14 14:02:53', 43, 'ge', 1, 1, 'ლობი', 'ლობი', NULL, '<p>მზიური გარდენსის მაცხოვრებლებისათვის მოეწყობა ლობი, სადაც მათ კომფორტულ გარემოში საქმიანი შეხვედრების გამართვის თუ უბრალოდ დასვენების შესაძლებლობა ექნებათ. აქვე იფუნქციონირებს ლობი ბარი, რომელიც ალკოჰოლური და არაალკოჰოლური სასმელების ფართო არჩევანს შემოგთავაზებთ.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/lobby', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'ლობი', 'მზიური გარდენსის მაცხოვრებლებისათვის მოეწყობა ლობი, სადაც მათ კომფორტულ გარემოში საქმიანი შეხვედრების გამართვის თუ უბრალოდ დასვენების შესაძლებლობა ექნებათ', 0, NULL),
(485, 43, 36, 3, '2019-03-29 14:52:17', '2019-08-14 14:02:53', 43, 'en', 1, 1, 'Lobby', 'Lobby', NULL, '<p>A comfortable and a spacious lobby will be arranged for the residents of Mziuri Gardens where they can relax or hold meetings. There will be a lobby bar as well serving wide selection of alcoholic and non-alcoholic beverages.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/lobby', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'lobby, alcoholic', 'Lobby - A comfortable and a spacious lobby will be arranged for the residents of Mziuri Gardens where they can relax or hold meetings. There will be a lobby bar as well serving wide selection of alcoholic and non-alcoholic beverages.', 0, NULL),
(486, 43, 36, 3, '2019-03-29 14:52:17', '2019-08-14 14:02:53', 43, 'ru', 1, 1, 'Лобби', 'Лобби', NULL, '<p>Для жильцов &laquo;Мзиури Гарденс&raquo; будет обустроено лобби, где они в комфортной обстановке смогут провести деловые встречи или просто отдохнуть. Здесь же будет работать лобби-бар с большим выбором алкогольных и безалкогольных напитков.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/lobby', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Лобби, лобби, будет', 'Лобби - Для жильцов «Мзиури Гарденс» будет обустроено лобби, где они в комфортной обстановке смогут провести деловые встречи или просто отдохнуть', 0, NULL),
(487, 44, 36, 3, '2019-03-29 14:52:33', '2019-08-14 14:02:53', 44, 'ge', 1, 1, 'პარკინგი ', 'პარკინგი ', NULL, '<p>მზიური გარდენსის საცხოვრებელი კომპლექსის ორი სართული (-1 და -2) პარკინგს დაეთმობა, რომელიც 500 ავტომობილზე იქნება გათვლილი. გარდა ამისა, ეზოს პერიმეტრზე მოხდება მცირე მასშტაბის ღია საპარკინგო სივრცის მოწყობა. აღსაღნიშნავია იქ ფაქტი, რომ ავტოსადგომების მოწყობის დროს სრულად იქნება გათვალისწინებული მოქმედი კანონმდებლობით გათვალისწინებული ნორმები. ჩვენს მულტიფუნქციურ კომპლექსში ყველაზე მწვანე ტრანსპორტისთვის, ველოსიპედებისთვისაც იქნება გამოყოფილი სპეციალური სადგომები.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/parking', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'parking, პარკინგი', 'პარკინგი  - Mziuri Gardens will feature two-level parking with capacity for 500 cars. In addition, a smaller-scale open-air parking will be arranged in the yard', 0, NULL),
(488, 44, 36, 3, '2019-03-29 14:52:33', '2019-08-14 14:02:53', 44, 'en', 1, 1, 'Parking', 'Parking', NULL, '<p>Mziuri Gardens will feature two-level parking with capacity for 500 cars. In addition, a smaller-scale open-air parking will be arranged in the yard. Our residential complex will also have a special parking areas allocated for the greenest transport, bicycles.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/parking', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'parking', 'Parking - Mziuri Gardens will feature two-level parking with capacity for 500 cars. In addition, a smaller-scale open-air parking will be arranged in the yard', 0, NULL),
(489, 44, 36, 3, '2019-03-29 14:52:33', '2019-08-14 14:02:53', 44, 'ru', 1, 1, 'Парковка', 'Парковка', NULL, '<p>Первые два этажа жилого комплекса &laquo;Мзиури Гарденс&raquo; займёт парковка на 500 автомобилей. Кроме этого, небольшая часть периметра двора также будет обустроена под открытую парковку. Важно отметить, что при застройке парковок, полностью будут учтены нормы грузинского законодательства. В нашем мультифункциональном жилом комплексе расположится стоянка и для самого &laquo;зелёного&raquo; транспорта &ndash; велосипедов.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/parking', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'raquo, Парковка, laquo', 'Парковка - Первые два этажа жилого комплекса &laquo;Мзиури Гарденс&raquo; займёт парковка на 500 автомобилей. Кроме этого, небольшая часть периметра двора также будет обустроена под открытую парковку', 0, NULL),
(490, 45, 36, 3, '2019-03-29 14:52:53', '2019-08-14 14:02:53', 46, 'ge', 1, 1, 'სწრაფი ლიფტები ', 'სწრაფი ლიფტები ', NULL, '<p>იმისთვის, რომ ლიფტის რიგში არ მოგიწიოთ დგომა, მზიური გარდენსის კომპლექსში შემავალი თითოეულ ბლოკში დამონტაჟებული იქნება ოთხი ამერიკული ფირმის Otis-ის ლიფტი, რომელიც თქვენს სწრაფ და უსაფრთხო გადაადგილებას უზრუნველყოფს.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/fast-elevators', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'ლიფტები, სწრაფი', 'სწრაფი ლიფტები  - იმისთვის, რომ ლიფტის რიგში არ მოგიწიოთ დგომა, მზიური გარდენსის კომპლექსში შემავალი თითოეულ ბლოკში დამონტაჟებული იქნება ოთხი ამერიკული ფირმის Otis-ის ლიფტი, რომელიც თქვენს სწრაფ და უსაფრთხო გადაადგილებას უზრუნველყოფს.', 0, NULL),
(491, 45, 36, 3, '2019-03-29 14:52:53', '2019-08-14 14:02:53', 46, 'en', 1, 1, 'Fast elevators', 'Fast elevators', NULL, '<p>4 high-quality elevators from the American company Otis will be installed in each building of Mziuri Gardens providing fast and safe transportation for our resident among floors.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/fast-elevators', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'elevators, fast', '4 high-quality elevators from the American company Otis will be installed in each building of Mziuri Gardens providing fast and safe transportation for our resident among floors.', 0, NULL),
(492, 45, 36, 3, '2019-03-29 14:52:53', '2019-08-14 14:02:53', 46, 'ru', 1, 1, 'Скоростной лифт', 'Скоростной лифт', NULL, '<p>Для того, чтобы Вы не ждали очереди в лифт, в каждом блоке комплекса &laquo;Мзиури Гарденс&raquo; будет установлено 4 скоростных лифта американской компании &laquo;Otis&raquo; , которые обеспечат быструю и безопасную транспортировку.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/fast-elevators', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'лифт, laquo, Скоростной, raquo', 'Для того, чтобы Вы не ждали очереди в лифт, в каждом блоке комплекса &laquo;Мзиури Гарденс&raquo; будет установлено 4 скоростных лифта американской компании &laquo;Otis&raquo; , которые обеспечат быструю и безопасную транспортировку.', 0, NULL),
