(496, 47, 36, 3, '2019-03-29 14:53:24', '2019-08-14 14:02:53', 105, 'ge', 1, 1, 'დამატებითი ინფრასტრუქტურა', 'დამატებითი ინფრასტრუქტურა', NULL, '<p>წვიამიანი ამინდში დროის მხიარულად გასატარებლად კომპლექსის ტერიტორიაზე შეგიძლიათ ითამაშოთ ბილიარდი, ან სულაც მეგობრებთან ერთად კარაოკე იმღეროთ. სამაგიდო თამაშებისის ( ნარდი, ჭადრაკი, დომინო, ბანქო) მოყვარულთათვისაც ცალკე იქნება გამოყოფილი ოთახი.</p>', NULL, NULL, 0, 'project/facilities-and-amenities/additional-facilities-and-amenities', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'ინფრასტრუქტურა, დამატებითი', 'დამატებითი ინფრასტრუქტურა - წვიამიანი ამინდში დროის მხიარულად გასატარებლად კომპლექსის ტერიტორიაზე შეგიძლიათ ითამაშოთ ბილიარდი, ან სულაც მეგობრებთან ერთად კარაოკე იმღეროთ', 0, NULL),
