(518, 54, 48, 3, '2019-03-29 14:55:23', '2019-08-14 14:02:53', 55, 'en', 1, 1, 'Doctor', 'Doctor', NULL, '<p>In Mziuri Gardens we do think about emergencies as well. That&rsquo;s why a GP will be available onsite who will provide the first aid in case of necessity.</p>', NULL, NULL, 0, 'project/services/doctor', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'doctor', 'Doctor - In Mziuri Gardens we do think about emergencies as well. That&rsquo;s why a GP will be available onsite who will provide the first aid in case of necessity.', 0, NULL),
(519, 54, 48, 3, '2019-03-29 14:55:23', '2019-08-14 14:02:53', 55, 'ru', 1, 1, 'Врач', 'Врач', NULL, '<p>Вместе с отдыхом и развлечениями, &laquo;Мзиури Гарденс&raquo; заботится и о непредвиденных ситуациях. Соответственно, на месте будет работать врач-терапевт, который при необходимости, окажет необходимую первую помощь.</p>', NULL, NULL, 0, 'project/services/doctor', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Врач', 'Врач - In Mziuri Gardens we do think about emergencies as well. That’s why a GP will be available onsite who will provide the first aid in case of necessity.', 0, NULL),
(520, 55, 48, 3, '2019-03-29 14:55:42', '2019-08-14 14:02:53', 56, 'ge', 1, 1, 'კომპლექსის მოვლა-პატრონობა ', 'კომპლექსის მოვლა-პატრონობა ', NULL, '<p>მზიური გარდენისის საცხოვრებელ კომპლექსში შემავალ მრავალფეროვან ინფრასტრუქტურასა და მწვანე საფარს რა თქმა უნდა შენარჩუნება და რუდუნებით მოვლა-პატრონობა სჭირდება, რაზეც ჩვენი გუნდის პროფესიონალი წევრები იზრუნებენ.</p>', NULL, NULL, 0, 'project/services/maintenance', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'კომპლექსის, პატრონობა, მოვლა', 'კომპლექსის მოვლა-პატრონობა  - Our professional team will be in charge of maintaining the diverse range of facilities and amenities and lush greenery of Mziuri Gardens.', 0, NULL),
(521, 55, 48, 3, '2019-03-29 14:55:42', '2019-08-14 14:02:53', 56, 'en', 1, 1, 'Maintenance', 'Maintenance', NULL, '<p>Our professional team will be in charge of maintaining the diverse range of facilities and amenities and lush greenery of Mziuri Gardens.</p>', NULL, NULL, 0, 'project/services/maintenance', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'maintenance', 'Maintenance - Our professional team will be in charge of maintaining the diverse range of facilities and amenities and lush greenery of Mziuri Gardens.', 0, NULL),
(522, 55, 48, 3, '2019-03-29 14:55:42', '2019-08-14 14:02:53', 56, 'ru', 1, 1, 'Обслуживание комплекса', 'Обслуживание комплекса', NULL, '<p>Для поддержания и сохранения всей разнообразной инфраструктуры и зелёного покрытия жилого комплекса &laquo;Мзиури Гарденс&raquo;, необходимы постоянная забота и уход. Эту работу возьмут на себя профессионалы от нашей команды.</p>', NULL, NULL, 0, 'project/services/maintenance', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Обслуживание, комплекса', 'Обслуживание комплекса - Our professional team will be in charge of maintaining the diverse range of facilities and amenities and lush greenery of Mziuri Gardens.', 0, NULL),
(523, 56, 48, 3, '2019-03-29 14:55:57', '2019-08-14 14:02:53', 101, 'ge', 1, 1, 'დამატებითი სერვისები', 'დამატებითი სერვისები', NULL, '<p>კომპლექსიდან გაუსვლელად ჩვენი მაცხოვრებელები ასევე შეძლებენ ისარგებლონ სილამაზის სალონით, ქიმწმენდის მომსახურებით. ადგილზე, ასევე იფუნქციონირებს სუვენირების მაღაზია და ხელმისაწვდომი იქნება, როგორც ბანკომატები, ასევე ჩასარიცხი აპარატები.</p>', NULL, NULL, 0, 'project/services/additional-services', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'დამატებითი, სერვისები', 'დამატებითი სერვისები - A beauty salon, dry cleaning, souvenir shop, as well as ATMs will be available onsite for our residents.', 0, NULL),
(524, 56, 48, 3, '2019-03-29 14:55:57', '2019-08-14 14:02:53', 101, 'en', 1, 1, 'Additional services', 'Additional services', NULL, '<p>A beauty salon, dry cleaning, souvenir shop, as well as ATMs will be available onsite for our residents.</p>', NULL, NULL, 0, 'project/services/additional-services', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'additional, services', 'Additional services - A beauty salon, dry cleaning, souvenir shop, as well as ATMs will be available onsite for our residents.', 0, NULL),
(525, 56, 48, 3, '2019-03-29 14:55:57', '2019-08-14 14:02:53', 101, 'ru', 1, 1, 'Дополнительные сервисы', 'Дополнительные сервисы', NULL, '<p>Не покидая комплекса, наши жильцы смогут воспользоваться салоном красоты и химчисткой. Также, на месте будет функционировать сувенирный магазин, банкомат и пей-бокс.</p>', NULL, NULL, 0, 'project/services/additional-services', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Дополнительные, сервисы', 'Дополнительные сервисы - A beauty salon, dry cleaning, souvenir shop, as well as ATMs will be available onsite for our residents.', 0, NULL),
