(529, 58, 57, 2, '2019-03-29 14:57:15', '2019-08-14 14:02:53', 58, 'ge', 1, 1, 'Batumi (GE)', 'Batumi', NULL, '<p>One of the most beautiful cities in Georgia, Batumi is an important tourist center on the Black sea coast. With its European streets and squares, mixture of old and new architecture, historical port, unique Botanical Garden, charming seaside boulevard, international brand hotels, caf&eacute;-bars and restaurants, Batumi makes up the modern face of Georgia.</p>\n<p><strong>Why Batumi?</strong></p>\n<ul>\n<li>Dynamically developing tourism and construction sectors</li>\n<li>Up to 2 million visitors in 2018 (+23%)</li>\n<li>One of the trendiest cities for 2019 according to&nbsp; Airbnb</li>\n<li>Diversity of tourism offerings- destination of all four seasons</li>\n</ul>', NULL, NULL, 0, 'batumi/batumi', '', 1, 1, 'https://mziurigardens.ge/files/batumi/batumi.jpg', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL),
(530, 58, 57, 2, '2019-03-29 14:57:15', '2019-08-14 14:02:53', 58, 'ru', 1, 1, 'Batumi (RU)', 'Batumi', NULL, '<p>One of the most beautiful cities in Georgia, Batumi is an important tourist center on the Black sea coast. With its European streets and squares, mixture of old and new architecture, historical port, unique Botanical Garden, charming seaside boulevard, international brand hotels, caf&eacute;-bars and restaurants, Batumi makes up the modern face of Georgia.</p>\n<p><strong>Why Batumi?</strong></p>\n<ul>\n<li>Dynamically developing tourism and construction sectors</li>\n<li>Up to 2 million visitors in 2018 (+23%)</li>\n<li>One of the trendiest cities for 2019 according to&nbsp; Airbnb</li>\n<li>Diversity of tourism offerings- destination of all four seasons</li>\n</ul>', NULL, NULL, 0, 'batumi/batumi', '', 1, 1, 'https://mziurigardens.ge/files/batumi/batumi.jpg', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL),
(531, 59, 57, 2, '2019-03-29 14:59:28', '2019-08-14 14:02:53', 60, 'ge', 1, 1, 'რატომ ბათუმი?', 'რატომ ბათუმი?', NULL, '<ul>\n<li>დინამიურად მზარდი ტურისტული სექტორი</li>\n<li>2 მილიონამდე ვიზიტორი 2018 წელს (+23 %)</li>\n<li>World Travel Award 2019-ის გამარჯვებული ნომინაციაში \"ევროპის წამყვანი მზარდი ტურისტული მიმართულება\"</li>\n<li>Airbnb-ის 2019 წლის ერთ-ერთი ყველაზე მოთხოვნადი სამოგზაურო ქალაქი</li>\n<li>ტურიზმის სახეობების მრავალფეროვნება - ოთხივე სეზონის დესტინაცია.</li>\n</ul>', NULL, NULL, 0, 'batumi/why-batumi', NULL, 0, 1, 'https://mziurigardens.ge/files/batumi/WHy-batumi.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'ბათუმი', 'რატომ ბათუმი? - დინამიურად მზარდი ტურისტული სექტორი2 მილიონამდე ვიზიტორი 2018 წელს (+23 %)Airbnb-ის 2019 წლის ერთ-ერთი ყველაზე მოთხოვნადი სამოგზაურო ქალაქიტურიზმის სახეობების მრავალფეროვნება - ოთხივე სეზონის დესტინაცია', 0, NULL);
