(532, 59, 57, 2, '2019-03-29 14:59:28', '2019-08-14 14:02:53', 60, 'en', 1, 1, 'Why Batumi', 'Why Batumi', NULL, '<ul>\n<li>Dynamically developing tourism and construction sectors</li>\n<li>Up to 2 million visitors in 2018 (+23%)</li>\n<li>One of the trendiest cities for 2019 according to&nbsp; Airbnb</li>\n<li>Diversity of tourism offerings- destination of all four seasons</li>\n</ul>', NULL, NULL, 0, 'batumi/why-batumi', NULL, 0, 1, 'https://mziurigardens.ge/files/batumi/WHy-batumi.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, batumi', 'Batumi', 0, NULL),
(533, 59, 57, 2, '2019-03-29 14:59:28', '2019-08-14 14:02:53', 60, 'ru', 1, 1, 'Почему Батуми', 'Почему Батуми', NULL, '<ul>\n<li>Динамично развивающийся туристический сектор</li>\n<li>2 миллиона визитёров в 2018 году(+23%)</li>\n<li>По данным &laquo;Airbnb&raquo;, Батуми один из самых запрашиваемых городов в 2019 году</li>\n<li>Различные виды туризма, рассчитанные на 4 сезона</li>\n</ul>', NULL, NULL, 0, 'batumi/why-batumi', NULL, 0, 1, 'https://mziurigardens.ge/files/batumi/WHy-batumi.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'Батуми, году, Почему', 'Динамично развивающийся туристический сектор2 миллиона визитёров в 2018 году(+23%)По данным «Airbnb», Батуми один из самых запрашиваемых городов в 2019 годуРазличные виды туризма, рассчитанные на 4 сезона', 0, NULL),
(534, 60, 57, 2, '2019-03-29 15:00:08', '2019-08-14 14:02:53', 87, 'ge', 1, 1, 'ეს საქართველოა', 'ეს საქართველოა', NULL, '<p>სტუმართმოყვარე ხალხის, უძველესი კულტურის, უნიკალური ფოლკლორის, ხელშეუხებელი ბუნების, ზომიერი კლიმატის, უგემრიელესი სამზარეულოს და ღვინის უძველესი ტრადიციების სამშობლო, საქართველო სულ უფრო და უფრო მიმზიდველი ხდება საერთაშორისო მოგზაურებისათვის. ამას ნათლად ცხადჰყოფს ტურიზმის სტატისტიკები და საერთაშორისო რეიტინგები. 2018 წელს საქართველოს 8.7 მილიონი ვიზიტორი ეწვია, ხოლო UNWTO-მ საქართველო მეოთხე ადგილზე დაასახელა, როგორც ერთ-ერთი ყველაზე მზარდი ტურისტული დესტინაცია. ტურიზმის პარალელურად, მშენებლობა ერთ-ერთი ყველაზე დინამიურად განვითარებადი სექტორია საქართველოში, სადაც უძრავ ქონებაში დაბანდების მსურველთა რაოდენობა წლიდან წლამდე იზრდება.</p>', NULL, NULL, 0, 'batumi/about-georgia', NULL, 0, 1, 'https://mziurigardens.ge/files/batumi/about-georgia.jpg', 'https://mziurigardens.ge/files/batumi/why-georgia.jpg', NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, საქართველოს', 'საქართველოს შესახებ', 0, NULL),
(535, 60, 57, 2, '2019-03-29 15:00:08', '2019-08-14 14:02:53', 87, 'en', 1, 1, 'About Georgia', 'About Georgia', NULL, '<p>The country of hospitable people, ancient culture and traditions, unique folklore, pristine nature, moderate climate, delicious cuisine and wine, Georgia is becoming more and more popular among international travelers proved by YOY growth statistics and rankings. In 2018 Georgia hosted 8.7 million visitors, while UNWTO nominated Georgia the fourth most dynamically growing tourism destination in the world. Alongside with tourism, construction sector is booming here as well with ever growing number of people wishing to invest in real estate.</p>', NULL, NULL, 0, 'batumi/about-georgia', NULL, 0, 1, 'https://mziurigardens.ge/files/batumi/about-georgia.jpg', 'https://mziurigardens.ge/files/batumi/why-georgia.jpg', NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, georgia', 'Georgia', 0, NULL),
(536, 60, 57, 2, '2019-03-29 15:00:08', '2019-08-14 14:02:53', 87, 'ru', 1, 1, 'О Грузии', 'О Грузии', NULL, '<p>Грузия - страна гостеприимных людей, древней культуры, уникального фольклора, нетронутой природы, умеренного климата, вкусной кухни и древнейших винодельческих традиций. Грузии становятся все больше и больше привлекательной для международных путешественников. Это наглядно демонстрирует статистика туризма и международные рейтинги. В 2018 году Грузию посетило 8,7 миллиона человек, а UNWTO (Всемирная туристская организация) поставила Грузию на 4 место, как одно из самых быстроразвивающихся туристических направлений.</p>', NULL, NULL, 0, 'batumi/about-georgia', NULL, 0, 1, 'https://mziurigardens.ge/files/batumi/about-georgia.jpg', 'https://mziurigardens.ge/files/batumi/why-georgia.jpg', NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, Грузии', 'О Грузии', 0, NULL),
