(606, 84, 0, 1, '2019-03-29 19:32:14', '2019-07-08 12:41:17', 84, 'ge', 25, 1, 'რატომ <span>მზიური გარდენსი</span>', 'რატომ <span>მზიური გარდენსი</span>', NULL, '<p>მზიური გარდენსი ახალი უნიკალური პროექტია კურორტ მახინჯაურში, რომლის მშენებლობაც ზღვიდან სულ რამოდენიმე მეტრში, ყოფილი სანატორიუმის ტერიტორიაზე მიმდინარეობს. მულტიფუნქციური კომპლექსის ტერიტორია 15 000 კვ.მ-ზე იქნება გაშენებული, საიდანაც უდიდესი ნაწილი უშუალოდ რეკრეაციულ ზონას და გამწვანებას დაეთმობა. კომპლექსის რეზიდენტებს წვდომა ექნებათ 5 ვარსკვლავიანი სასტუმროს, ინფრასტრუქტურასა და სერვისებთან.</p>\n<p>&nbsp;</p>', NULL, 'https://mziurigardens.ge/ge/project', 0, 'why-mziuri-gardens', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, complex', 'რატომ <span>Mziuri Gardens</span> - Mziuri Gardens is a new residential complex currently under construction in resort Makhinjauri few steps away from the Black Sea beach', 0, NULL),
(607, 84, 0, 1, '2019-03-29 19:32:14', '2019-04-08 15:51:43', 84, 'en', 25, 1, 'Why <span>Mziuri Gardens</span>', 'Why <span>Mziuri Gardens</span>', NULL, '<p>Mziuri Gardens is a new residential complex currently under construction in resort Makhinjauri few steps away from the Black Sea beach. The area of the complex stretches over 15 000 sq.m. major part out of which will be allocated to lush green&nbsp;garden&nbsp;with century-old pine trees and other endemic plants.</p>', NULL, 'https://mziurigardens.ge/en/project', 0, 'why-mziuri-gardens', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, why, complex', 'Why Mziuri Gardens - Mziuri Gardens is a new residential complex currently under construction in resort Makhinjauri few steps away from the Black Sea beach', 0, NULL),
(608, 84, 0, 1, '2019-03-29 19:32:14', '2019-04-08 15:56:15', 84, 'ru', 25, 1, 'Почему <span>Мзиури Гарденс</span>', 'Почему <span>Мзиури Гарденс</span>', NULL, '<p>&laquo;Мзиури Гарденс&raquo; - новый уникальный проект на курорте Махинджаури, строительство которого ведется в нескольких метрах от моря, на месте бывшего санатория. Территория нового мультифункционального комплекса &ndash; 15 000 кв/м,&nbsp;большинство территории которого будет отведено под озеленение и рекреационную зону.</p>', NULL, 'https://mziurigardens.ge/ru/project', 0, 'why-mziuri-gardens', NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Мзиури, Гарденс, Почему, которого', 'Почему <span>Мзиури Гарденс</span> - «Мзиури Гарденс» - новый уникальный проект на курорте Махинджаури, строительство которого ведется в нескольких метрах от моря, на месте бывшего санатория', 0, NULL),
(609, 85, 57, 2, '2019-03-29 19:36:46', '2019-08-14 14:02:53', 85, 'ge', 1, 1, 'Why Batumi (GE)', 'Why Batumi', NULL, '<p>One of the most beautiful cities in Georgia, Batumi is an important tourist center on the Black sea coast. With its European streets and squares, mixture of old and new architecture, historical port, unique Botanical Garden, charming seaside boulevard, international brand hotels, caf&eacute;-bars and restaurants, Batumi makes up the modern face of Georgia.</p>', NULL, NULL, 0, 'batumi/why-batumi', '', 1, 1, 'https://mziurigardens.ge/files/batumi/batumi.jpg', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL),
