(614, 87, 57, 2, '2019-03-29 19:37:48', '2019-08-14 14:02:53', 59, 'ge', 1, 1, 'ბათუმის შესახებ', 'ბათუმის შესახებ', NULL, '<p>საქართველოს ერთ-ერთი ულამაზესი ქალაქი ბათუმი უმნიშვნელოვანესი ტურისტული ცენტრია მთელს შავიზღვის რეგიონში. ევროპული ქუჩებითა და მოედნებით, ძველი და ახალი არქიტექტურის ნაზავით, ისტორიული პორტით, უნიკალური ბოტანიკური ბაღით, ზღვისპირა ბულვარით, საერთაშორისო ბრენდის სასტუმროებით, კაფე-ბარებითა და რესტორნებით ბათუმი თანამედროვე საქართველოს სახეა.</p>', NULL, NULL, 0, 'batumi/about-batumi', NULL, 0, 1, 'https://mziurigardens.ge/files/batumi/about-batumi.jpg', 'https://mziurigardens.ge/files/batumi/WHy-batumi.jpg', NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, batumi, why', 'ბათუმის შესახებ', 0, NULL),
(615, 87, 57, 2, '2019-03-29 19:37:48', '2019-08-14 14:02:53', 59, 'en', 1, 1, 'About Batumi', 'About Batumi', NULL, '<p>One of the most beautiful cities in Georgia, Batumi is an important tourist center on the Black sea coast. With its European streets and squares, mixture of old and new architecture, historical port, unique Botanical Garden, charming seaside boulevard, international brand hotels, caf&eacute;-bars and restaurants, Batumi makes up the modern face of Georgia.</p>', NULL, NULL, 0, 'batumi/about-batumi', NULL, 0, 1, 'https://mziurigardens.ge/files/batumi/about-batumi.jpg', 'https://mziurigardens.ge/files/batumi/why-batumi.jpg', NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, batumi', 'About Batumi', 0, NULL),
(616, 87, 57, 2, '2019-03-29 19:37:48', '2019-08-14 14:02:53', 59, 'ru', 1, 1, 'О Батуми', 'О Батуми', NULL, '<p>Один из красивейших городов Грузии, Батуми, является важнейшим туристическим центром черноморского региона. Батуми &ndash; это европейские улицы и площади, старая и новая архитектура, исторический порт, уникальный ботанический сад, приморский бульвар, гостиницы международных брендов, кафе-бары, рестораны. Батуми это лицо современной Грузии.</p>', NULL, NULL, 0, 'batumi/about-batumi', NULL, 0, 1, 'https://mziurigardens.ge/files/batumi/about-batumi.jpg', 'https://mziurigardens.ge/files/batumi/why-batumi.jpg', NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, Батуми', 'О Батуми', 0, NULL),
(617, 88, 57, 2, '2019-03-29 19:39:05', '2019-08-14 14:02:53', 88, 'ge', 1, 1, 'რატომ საქართველო', 'რატომ საქართველო', NULL, '<ul>\n<li>პოლიტიკური სტაბილურობა</li>\n<li>გარანტირებულად დაცული საკუთრების უფლება</li>\n<li>კორუფციის დაბალი დონე (პირველი პოსტ საბჭოთა ქვეყნებში Transparency International -ის მიხედვით)</li>\n<li>ძალიან დაბალი გადასახადი ქონებაზე</li>\n<li>ერთ-ერთი ყველაზე უსაფრთხო ქვეყანა (მე-5-ე ადგილი Numbeo-ს მიხედვით)</li>\n<li>ბიზნესის კეთების სიმარტივე (მსოფლიო ბანკის მონაცემებით მე-6-ე ადგილი მსოფლიოში)</li>\n<li>მუდმივი ცხოვრებისა და ორმაგი მოქალაქეობის მოპოვების მარტივი პროცედურები</li>\n<li>უძრავი ქონების შეძენის და გაფორმების მარტივი პროცედურები (ჯამში 10-15 წუთი)</li>\n</ul>', NULL, NULL, 0, 'batumi/why-georgia', NULL, 0, 1, 'https://mziurigardens.ge/files/batumi/why-georgia.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, საქართველო', 'რატომ საქართველო', 0, NULL),
(618, 88, 57, 2, '2019-03-29 19:39:05', '2019-08-14 14:02:53', 88, 'en', 1, 1, 'Why Georgia', 'Why Georgia', NULL, '<ul>\n<li>Political Stability</li>\n<li>Guaranteed ownership right</li>\n<li>Easy procedures for&nbsp; purchasing and registering real estate (10-15 minutes in total)</li>\n<li>Easy procedures for obtaining residence permit and&nbsp; dual citizenship;</li>\n<li>One&nbsp; of the safest countries in the world (the fifth according to Numbeo)</li>\n<li>Low taxes on&nbsp; property</li>\n<li>Low level of corruption (the first among post-soviet countries according to Transparency International)</li>\n<li>Ease of doing business (the&nbsp; 6th in the world according to World Bank data)</li>\n<li>Moderate climate with all four seasons (Spring, Summer, Autumn, Winter)</li>\n</ul>', NULL, NULL, 0, 'batumi/why-georgia', NULL, 0, 1, 'https://mziurigardens.ge/files/batumi/why-georgia.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, georgia, why', 'Why Georgia', 0, NULL),
(619, 88, 57, 2, '2019-03-29 19:39:05', '2019-08-14 14:02:53', 88, 'ru', 1, 1, 'Почему Грузия', 'Почему Грузия', NULL, '<ul>\n<li>Политическая стабильность</li>\n<li>Гарантированно защищённое право собственности</li>\n<li>Простая процедура покупки и оформления недвижимости (10-15 минут)</li>\n<li>Простая процедура получения вида на жительство и двойного гражданства</li>\n<li>Низкий уровень коррупции (1 место в странах бывшего СССР, согласно данным Transparency International)</li>\n<li>Низкий налог на собственность</li>\n<li>Лёгкость ведения бизнеса (6 место в мире по данным Всемирного банка)</li>\n<li>Одна из самых безопасных стран (5 место по данным Numbeo)</li>\n<li>Умеренный климат, включая все 4 сезона (весна, лето, осень, зима)</li>\n</ul>', NULL, NULL, 0, 'batumi/why-georgia', NULL, 0, 1, 'https://mziurigardens.ge/files/batumi/why-georgia.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'gardens, mziuri, Грузия, Почему', 'Почему Грузия', 0, NULL),
