(653, 100, 4, 2, '2019-04-08 20:05:20', '2019-08-14 14:02:53', 21, 'ge', 1, 1, 'ბინები მწვანე კარკასით', 'ბინები მწვანე კარკასით', NULL, '<p>მზიური გარდენსში ბინები ბარდება მწვანე კარკასის მდგომარეობით.</p>\n<p>მწვანე კარკასში შედის:</p>\n<ul>\n<li>შიდა ტიხრები&nbsp;</li>\n<li>შებათქაშებული კედლები</li>\n<li>მოჭიმული იატაკი</li>\n<li>მოპირკეთებული აივნები&nbsp;</li>\n<li>გათბობა გაგრილების სისტემა</li>\n<li>ელექტროგაყვანილობა</li>\n<li>წყალგაყვანილობა (კანალიზაცია)</li>\n</ul>', NULL, NULL, 0, 'project/flats-with-green-shell', NULL, 0, 1, 'https://mziurigardens.ge/files/project/about-mziuri-gardens-3.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'მწვანე, ბინები, კარკასით', 'მზიური გარდენსში ბინები ბარდება მწვანე კარკასის მდგომარეობით.მწვანე კარკასში შედის: გათბობა გაგრილების ცენტრალური სისტემამოჭიმული იატაკიშებათქაშებული კედლებიელექტროგაყვანილობაწყალგაყვანილობა (კანალიზაცია)', 0, NULL),
