(126, 21, 'keywords', 'Keywords', 'Мзиури гарденс, батуми, махинджаури, квартиры в батуми, купит квартиру у моря в батуми, грузия, недвижимост в батуми на берегу моря', 'ru', 0),
(127, 22, 'description', 'Description', 'მზიური გარდენსი ახალი უნიკალური პროექტია კურორტ მახინჯაურში, რომლის მშენებლობაც ზღვიდან სულ რამოდენიმე მეტრში მიმდინარეობს. მულტიფუნქციური კომპლექსის ტერიტორია 15 000 კვ.მ-ზე იქნება გაშენებული, საიდანაც  ძირითადი ნაწილი რეკრეაციულ ზონას და  გამწვანებას დაეთმობა. პროექტი მოიცავს სამ 14-სართულიან კორპუსს, რომელთაგან ერთ-ერთში განთავსებული იქნება სასტუმრო კომპლექსი. აღსანიშნავია, რომ მზიური გარდენსში შენობის ყველა სართული და მთლიანი სივრცე სრულად ადაპტირებული იქნება. პროექტის ავტორი და ინვესტორი ბრიტანული კომპანია MRMU-ია.', 'ge', 0),
(128, 22, 'description', 'Description', 'Mziuri Gardens is a new residential complex currently under construction in resort Makhinjauri few steps away from the Black Sea beach. The area of the complex stretches over 15 000 sq.m. major part out of which will be allocated to lush green garden with century-old pine trees and other endemic plants.', 'en', 0),
(129, 22, 'description', 'Description', '«Мзиури Гарденс» - новый уникальный проект на курорте Махинджаури, строительство которого ведется в нескольких метрах от моря, на месте бывшего санатория. Территория нового мультифункционального комплекса – 15 000 кв/м, большинство территории которого будет отведено под озеленение и рекреационную зону.', 'ru', 0),
